FeedServiceControlType:
  type: string
  nullable: true
  enum:
  - UPLOAD_COUNT_LIMIT
  - FILE_ROWS_LIMIT
  - FILE_SIZE_LIMIT_COMPRESS
  - FILE_SIZE_LIMIT_UNCOMPRESS
  - UNKNOWN
  title: FeedServiceControlType
  description: |
    <div lang="ja">FeedServiceControlTypeは、制御タイプを表します。</div>
    <div lang="en">FeedServiceControlType serves control type.</div>
    <hr>
    <p>* <code>UPLOAD_COUNT_LIMIT</code> - <span lang="ja">アップロード回数上限</span><span lang="en">Upload limit.</span></p>
    <p>* <code>FILE_ROWS_LIMIT</code> - <span lang="ja">ファイル行数上限</span><span lang="en">File line limit.</span></p>
    <p>* <code>FILE_SIZE_LIMIT_COMPRESS</code> - <span lang="ja">ファイルサイズ上限(圧縮)</span><span lang="en">File size limit (compressed).</span></p>
    <p>* <code>FILE_SIZE_LIMIT_UNCOMPRESS</code> - <span lang="ja">ファイルサイズ上限(非圧縮)</span><span lang="en">File size limit (uncompressed).</span></p>
    <p>* <code>UNKNOWN</code> - <span lang="ja">未知の値です。</span><span lang="en">Unknown Value</span></p>
